(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"719977","type":"CustomJS"},{"attributes":{},"id":"720016","type":"AllLabels"},{"attributes":{},"id":"719853","type":"SaveTool"},{"attributes":{"coordinates":null,"group":null},"id":"719689","type":"Title"},{"attributes":{"coordinates":null,"formatter":{"id":"719963"},"group":null,"major_label_policy":{"id":"719964"},"minor_tick_line_color":null,"ticker":{"id":"719935"}},"id":"719934","type":"LinearAxis"},{"attributes":{"fill_alpha":{"value":0.2},"fill_color":{"field":"inc","transform":{"id":"719628"}},"hatch_alpha":{"value":0.2},"hatch_color":{"field":"inc","transform":{"id":"719628"}},"line_alpha":{"value":0.2},"line_color":{"field":"inc","transform":{"id":"719628"}},"top":{"field":"Volume"},"width":{"value":0.8},"x":{"field":"index"}},"id":"719867","type":"VBar"},{"attributes":{"overlay":{"id":"719803"}},"id":"719798","type":"BoxZoomTool"},{"attributes":{"coordinates":null,"data_source":{"id":"719626"},"glyph":{"id":"719865"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"719867"},"nonselection_glyph":{"id":"719866"},"view":{"id":"719869"}},"id":"719868","type":"GlyphRenderer"},{"attributes":{"label":{"value":"Trades (1228)"},"renderers":[{"id":"719904"}]},"id":"719921","type":"LegendItem"},{"attributes":{},"id":"719700","type":"UnionRenderers"},{"attributes":{"coordinates":null,"group":null},"id":"719906","type":"Title"},{"attributes":{},"id":"719840","type":"BasicTicker"},{"attributes":{"data":{"Close":{"__ndarray__":"PQrXo3B9QkAzMzMzM/NBQAAAAAAAIEJA4XoUrkeBQkCamZmZmVlCQFyPwvUovEJAZmZmZmamQkCF61G4HsVCQM3MzMzMDENA9ihcj8IVQ0BxPQrXo7BCQMP1KFyPgkJAH4XrUbheQkDsUbgehQtEQEjhehSux0NAUrgehevxQ0B7FK5H4fpDQEjhehSuB0RA7FG4HoUrREBcj8L1KPxDQAAAAAAAIERAZmZmZmZmREApXI/C9YhEQDMzMzMzc0RA4XoUrkfhREA9CtejcB1FQAAAAAAAIEVAuB6F61EYRUAK16NwPYpEQKRwPQrXg0RAw/UoXI/CR
